import React from "react";
import "./Emptyview";
import img from "../../Asserts/Logos/kiddostardez.png";

const EmptyView = () => {
  return (
    <div>
      <div class="three-body">
        <div class="three-body__dot"></div>
        <div class="three-body__dot"></div>
        <div class="three-body__dot"></div>
      </div>
    </div>
  );
};

export default EmptyView;
